import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

const slides = [
    {
      image: 'https://cdn.shortpixel.ai/spai/w_800+q_glossy+ret_img+to_webp/https://entradas.quelapaseslindo.com.ar/wp-content/uploads/red-hot-chili-peppers-argentina-2023.jpg',
      title: 'Red Hot Chili Peppers',
      description: '31 de Octubre',
    },
    {
      image: 'https://via.placeholder.com/800x600',
      title: 'Título de la diapositiva 2',
      description: 'Descripción de la diapositiva 2',
    },
    {
      image: 'https://via.placeholder.com/800x600',
      title: 'Título de la diapositiva 3',
      description: 'Descripción de la diapositiva 3',
    },
    {
        image: 'https://via.placeholder.com/800x600',
        title: 'Título de la diapositiva 3',
        description: 'Descripción de la diapositiva 3',
      }
  ];


  const MySlider = () => {
    const settings = {
      dots: true,
      infinite: false,
      speed: 500,
      slidesToShow: 4,
      slidesToScroll: 2,
    };
  
    return (
      <Slider {...settings}>
        {slides.map((slide) => (
          <div key={slide.title}>
            <img src={slide.image} alt={slide.title} />
            <h3>{slide.title}</h3>
            <p>{slide.description}</p>
          </div>
        ))}
      </Slider>
    );
  };
  export default MySlider;
